import React, {FC, useState} from 'react';
import Alert from '@mui/material/Alert';

export interface WinnerProps{
    winnerString:()=>string
}
const Winner:FC<WinnerProps> = ({winnerString}) => {
    const [winner,setWinner]=useState(()=>'none')
    setWinner(winnerString)

    if(winner!='none'){
        return (
            <div>
                <Alert style={{
                    visibility:"hidden"
                }} severity="success">{winner}</Alert>
            </div>
        );
    }
    else{
        return (
            <div>
                <Alert style={{
                    visibility:"visible"
                }} severity="success">{winner}</Alert>
            </div>
        );
    }

};

export default Winner;
